import React from 'react'

export default function ParaLabelInputDeux({boolean,placeholder,label}) {
    if(boolean==="true"){
        return(
            <p className='sup1400:mb-[50px] text-white flex flex-col mb-[15px] '>
                <label className='sup1400:mb-[20px] sup1400:text-[25px] ml-[30px] mb-[5px] ' htmlFor="">{label}</label>
                <input className='sup1400:placeholder:text-[21px]  sup1400:py-[20px]  outline-none rounded-[15px] p-[10px] bg-gris opacity-[0.5]' placeholder={placeholder} type="text" />
            </p> 
        )
    }
    if(boolean!== "true"){
         return (
            <p className='sup1400:mb-[100px] text-white flex flex-col mb-[50px] '>
                <label className='sup1400:mb-[20px] sup1400:text-[25px] ml-[30px] mb-[5px] ' htmlFor="">{label} </label>
                <input className='sup1400:placeholder:text-[21px] outline-none rounded-[15px] p-[10px] pb-[150px] bg-gris opacity-[0.5]' placeholder={placeholder} type="text" />
            </p> 
        )
    }

}
